import{_ as t,c as a,ah as o,o as i}from"./chunks/framework.BWXOFiC5.js";const c=JSON.parse('{"title":"Frequently Asked Questions","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/FAQ.md","filePath":"Documentation/FAQ.md"}'),s={name:"Documentation/FAQ.md"};function n(r,e,l,m,d,h){return i(),a("div",null,e[0]||(e[0]=[o(`<h1 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title"><em>ImmyBot&#39;s EV code-signing certificate is changing on Feb. 11th, 2025</em></p><p>Please see the <a href="#what-should-i-do-about-immybots-upcoming-code-signing-certificate-change">section below</a> for more details on updating security exclusions.</p></div><div class="danger custom-block"><p class="custom-block-title"><em>ImmyBot no longer supports Windows 7, Server 2008 (or Server 2012 w/o <a href="https://learn.microsoft.com/en-us/windows-server/get-started/extended-security-updates-overview" target="_blank" rel="noreferrer">ESUs</a>) machines.</em></p><p>Please see the <a href="#what-windows-versions-does-immyagent-support">section below</a> for more details.</p></div><p>This comprehensive FAQ addresses common questions about ImmyBot, including licensing, deployment, configuration, and troubleshooting. If you don&#39;t find the answer to your question here, please check our <a href="/Documentation/Troubleshooting/common-issues.html">Common Issues</a> guide or contact our <a href="mailto:support@immy.bot" target="_blank" rel="noreferrer">support team</a>.</p><h2 id="licensing-and-plans" tabindex="-1">Licensing and Plans <a class="header-anchor" href="#licensing-and-plans" aria-label="Permalink to &quot;Licensing and Plans&quot;">​</a></h2><h4 id="what-is-the-difference-between-the-starter-and-standard-plan" tabindex="-1">What is the difference between the Starter and Standard plan? <a class="header-anchor" href="#what-is-the-difference-between-the-starter-and-standard-plan" aria-label="Permalink to &quot;What is the difference between the Starter and Standard plan?&quot;">​</a></h4><details class="details custom-block"><summary>Standard allows for ongoing maintenance of agents</summary><p>Both plans allow you to import all of your existing agents into ImmyBot if you use one of our support integrations.</p><p>Both plans allow installing and updating of the ImmyBot agent on all of your existing computers.</p><p>Both plans allow running maintenance on all of your computers given that the computer was imported into ImmyBot in the last 7 days.</p></details><h4 id="starter-plan" tabindex="-1">Starter Plan <a class="header-anchor" href="#starter-plan" aria-label="Permalink to &quot;Starter Plan&quot;">​</a></h4><details class="details custom-block"><summary>Starter does not charge maintenance per computer since it does not support ongoing maintenance for your computers.</summary><p>Once a computer has been in ImmyBot for at least 7 days, maintenance can no longer be executed against it. This includes all onboarding, full maintenance, and adhoc sessions. If you need to manage ongoing maintenance against a computer older than 7 days, then you will need to upgrade to Standard.</p></details><h4 id="standard-plan" tabindex="-1">Standard Plan <a class="header-anchor" href="#standard-plan" aria-label="Permalink to &quot;Standard Plan&quot;">​</a></h4><details class="details custom-block"><summary>Standard counts per maintained computer, since it supports ongoing maintenance, until you hit your cap.</summary><p>Standard includes unlimited onboarding computers.</p><p>Onboarding a computer does not count towards your standard licenses.</p><p>You will see a check mark on the top left hand corner of the computer icon when reviewing.</p></details><h4 id="what-is-a-maintained-computer" tabindex="-1">What is a maintained computer? <a class="header-anchor" href="#what-is-a-maintained-computer" aria-label="Permalink to &quot;What is a maintained computer?&quot;">​</a></h4><details class="details custom-block"><summary>A computer that has had a maintenance session run against it on or after day 8</summary><p>Since we allow you to import all of your agents into ImmyBot, we don&#39;t simply charge per agent.</p><p>Instead, we only consider computers that have received ongoing maintenance.</p><p>A computer has received ongoing maintenance if an onboarding, full maintenance, or adhoc session has been run against it after the computer has been in ImmyBot for over 7 days.</p></details><h4 id="maintenance-per-computer" tabindex="-1">Maintenance per computer <a class="header-anchor" href="#maintenance-per-computer" aria-label="Permalink to &quot;Maintenance per computer&quot;">​</a></h4><details class="details custom-block"><summary>We only charge per maintained computer</summary><p>When maintenance is performed against a computer older than 7 days, ImmyBot will check the following:</p><ol><li><p>Is this computer already counted towards your maintained count?</p><ul><li>If it is, then maintenance can be performed on this computer.</li></ul></li><li><p>Are we at the maximum number of maintained computers for this subscription?</p><ul><li>If it is not, then this computer will be added to your active maintained computer count, and maintenance can be performed on this computer.</li></ul></li></ol><p>When a subscription is at the maximum maintained count, only maintenance for computers considered in the count will be allowed. In order to run maintenance on other computers, you can purchase more computer licenses for your subscription.</p></details><h4 id="for-purchasing-immy-do-you-guys-prefer-credit-card-or-invoice-would-you-rather-us-pay-monthly-or-can-we-pay-all-upfront" tabindex="-1">For purchasing Immy, do you guys prefer Credit card or invoice? Would you rather us pay monthly, or can we pay all upfront? <a class="header-anchor" href="#for-purchasing-immy-do-you-guys-prefer-credit-card-or-invoice-would-you-rather-us-pay-monthly-or-can-we-pay-all-upfront" aria-label="Permalink to &quot;For purchasing Immy, do you guys prefer Credit card or invoice? Would you rather us pay monthly, or can we pay all upfront?&quot;">​</a></h4><details class="details custom-block"><summary>We bill automatically to a credit card every month.</summary><p>We utilize an external PCI DSS compliant platform to handle all billing.</p></details><h2 id="deployment-and-configuration" tabindex="-1">Deployment and Configuration <a class="header-anchor" href="#deployment-and-configuration" aria-label="Permalink to &quot;Deployment and Configuration&quot;">​</a></h2><h4 id="will-immybot-start-doing-anything-without-my-consent-like-when-i-save-a-deployment-will-it-automatically-deploy" tabindex="-1">Will ImmyBot start doing anything without my consent? Like when I save a deployment, will it automatically deploy? <a class="header-anchor" href="#will-immybot-start-doing-anything-without-my-consent-like-when-i-save-a-deployment-will-it-automatically-deploy" aria-label="Permalink to &quot;Will ImmyBot start doing anything without my consent? Like when I save a deployment, will it automatically deploy?&quot;">​</a></h4><details class="details custom-block"><summary>ImmyBot does not deploy anything automatically.</summary><p>You can feel safe saving your Deployments. Think of them like documenting how things SHOULD be. If you want ImmyBot to automatically enforce deployments, you would need the ImmyBot Standard plan which allows you to create schedules.</p><p>Think of it like if Group Policy only updated if you manually ran gpupdate /force or otherwise specified a schedule for the gpupdates to happen. We understand that updating and installing software on existing computers can be intrusive to the user which is why we schedule these actions out and give the user the ability to postpone via interactive emails.</p><p>IMPORTANT: If you setup integration with your RMM, when you map an RMM client to an ImmyBot tenant, ImmyBot will begin running inventory scripts on those machines every 24 hours. These scripts are read-only, but if you have aggressive monitoring software it may cause false alarms.</p></details><h4 id="what-if-i-don-t-know-which-user-will-be-using-the-computer" tabindex="-1">What if I don’t know which user will be using the computer? <a class="header-anchor" href="#what-if-i-don-t-know-which-user-will-be-using-the-computer" aria-label="Permalink to &quot;What if I don’t know which user will be using the computer?&quot;">​</a></h4><details class="details custom-block"><summary>It&#39;s ok, but do your best to find out</summary><p>Do your best to find out, or assign machines to specific users ahead of time. Without this, user level customizations are impossible. However, you may find yourself in a shared-computer scenario where every computer gets the same 365 applications. Simply create a deployment for those 365 applications for all computers under that tenant.</p></details><h4 id="why-are-my-computers-stuck-in-identification" tabindex="-1">Why are my computers stuck in identification? <a class="header-anchor" href="#why-are-my-computers-stuck-in-identification" aria-label="Permalink to &quot;Why are my computers stuck in identification?&quot;">​</a></h4><details class="details custom-block"><summary>Its either a security platform, or WMI is broken</summary><ol><li><p>The machine has a security tool like Defender for Endpoint, Crowdstrike, Bitdefender or Threatlocker blocking our scripts from running.</p><ul><li>You&#39;ll want to create exclusions for ImmyBot</li></ul></li><li><p>WMI is broken on the machine (Usually on older machines)</p></li></ol></details><h4 id="how-are-we-able-to-define-which-version-of-windows-is-installed-during-the-initial-setup" tabindex="-1">How/are we able to define which version of Windows is installed during the initial setup? <a class="header-anchor" href="#how-are-we-able-to-define-which-version-of-windows-is-installed-during-the-initial-setup" aria-label="Permalink to &quot;How/are we able to define which version of Windows is installed during the initial setup?&quot;">​</a></h4><details class="details custom-block"><summary>ImmyBot doesn&#39;t install Windows on bare metal.</summary><p>The workflow is you unbox the system from Dell, HP, Lenovo, Microsoft, or your manufacturer of choice and insert the USB with the ImmyBot.ppkg file at the root while the machine is at the out of box screen.</p><p>We don&#39;t image the machine, we script the factory image into compliance.</p><p>We can, however, install Feature Updates during Onboarding (as well as after Onboarding)</p></details><h4 id="since-immy-bot-doesn-t-use-an-iso-does-it-require-a-device-to-have-the-ability-to-have-2-usb-devices-plugged-in-one-for-a-windows-iso-and-one-for-the-immybot-ppkg" tabindex="-1">Since Immy.Bot doesn’t use an ISO, does it require a device to have the ability to have 2 USB devices plugged in? One for a Windows ISO and one for the ImmyBot ppkg? <a class="header-anchor" href="#since-immy-bot-doesn-t-use-an-iso-does-it-require-a-device-to-have-the-ability-to-have-2-usb-devices-plugged-in-one-for-a-windows-iso-and-one-for-the-immybot-ppkg" aria-label="Permalink to &quot;Since Immy.Bot doesn’t use an ISO, does it require a device to have the ability to have 2 USB devices plugged in? One for a Windows ISO and one for the ImmyBot ppkg?&quot;">​</a></h4><details class="details custom-block"><summary>Create a Windows installation flash drive and put the PPKG in the root</summary><p>If you want to wipe the computer you can use the Media Creation Tool to create a Windows Setup flash drive and then put our .ppkg file on the root of the flash drive. After installing Windows, it will automatically apply the provisioning package. You should only have 1 .ppkg file per USB, otherwise you will have to manually select which on to use.</p></details><h4 id="does-immy-s-setup-process-support-a-usb-nic-for-wifi-if-so-how-do-we-present-those-drivers-to-immy-or-do-we-even-need-to" tabindex="-1">Does Immy’s setup process support a USB NIC for WiFi? If so, how do we present those drivers to Immy, or do we even need to? <a class="header-anchor" href="#does-immy-s-setup-process-support-a-usb-nic-for-wifi-if-so-how-do-we-present-those-drivers-to-immy-or-do-we-even-need-to" aria-label="Permalink to &quot;Does Immy’s setup process support a USB NIC for WiFi?  If so, how do we present those drivers to Immy, or do we even need to?&quot;">​</a></h4><details class="details custom-block"><summary>You can&#39;t ImmyBot runs on top of Windows</summary><p>I&#39;ve found Windows has built in drivers for most USB NICs. If yours doesn&#39;t have drivers built into Windows, I&#39;d suggest purchasing one that does.</p></details><h4 id="does-immybot-rely-on-the-windows-preboot-for-drivers-during-initial-deployment-or-does-the-immybot-agent-installer-have-drivers" tabindex="-1">Does ImmyBot rely on the Windows preboot for drivers during initial deployment, or does the ImmyBot agent installer have drivers? <a class="header-anchor" href="#does-immybot-rely-on-the-windows-preboot-for-drivers-during-initial-deployment-or-does-the-immybot-agent-installer-have-drivers" aria-label="Permalink to &quot;Does ImmyBot rely on the Windows preboot for drivers during initial deployment, or does the ImmyBot agent installer have drivers?&quot;">​</a></h4><details class="details custom-block"><summary>Since we are working with the manufacturer&#39;s image, all drivers are typically installed.</summary><p>We will automatically install Dell, HP, and Lenovo driver and BIOS updates via those manufacturer&#39;s tools (Dell Command, HP Image Assistant, Lenovo System Update)</p></details><h4 id="are-there-any-repository-limits-for-software-deployments-either-to-the-size-of-custom-software-or-number-of-custom-installers-we-can-upload" tabindex="-1">Are there any repository limits for software deployments? Either to the size of custom software or number of custom installers we can upload? <a class="header-anchor" href="#are-there-any-repository-limits-for-software-deployments-either-to-the-size-of-custom-software-or-number-of-custom-installers-we-can-upload" aria-label="Permalink to &quot;Are there any repository limits for software deployments?  Either to the size of custom software or number of custom installers we can upload?&quot;">​</a></h4><details class="details custom-block"><summary>No. Please don&#39;t be the reason that this changes.</summary><p>There are currently no limits. Everything you upload goes into an Azure Storage Account created just for your ImmyBot instance. Don&#39;t be the reason we can&#39;t have nice things.</p></details><h4 id="is-immybot-able-to-reset-windows-wipe-and-reload-a-computer" tabindex="-1">Is ImmyBot able to reset Windows / Wipe and Reload a computer? <a class="header-anchor" href="#is-immybot-able-to-reset-windows-wipe-and-reload-a-computer" aria-label="Permalink to &quot;Is ImmyBot able to reset Windows / Wipe and Reload a computer?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, expand for instructions.</summary><p>Yes, the current process will be simplified but here&#39;s how to do it:</p><ol><li>Click Download ImmyAgent on the left to create a PPKG with the Windows Reset option selected</li></ol><p><img src="https://user-images.githubusercontent.com/1424395/235902691-46845e47-2965-4141-a68c-2004a02b7300.png" alt="image"></p><p><img src="https://user-images.githubusercontent.com/1424395/235902014-4a63dc2f-efe3-454c-a2f4-5c6578190982.png" alt="image"></p><ol start="2"><li>Create a Deployment for &quot;Apply Provisioning Package (PPKG)&quot; to deploy the PPKG to the specified machine</li></ol><p><img src="https://user-images.githubusercontent.com/1424395/235902286-5ad3303e-167c-4cd4-abb6-5dea45da3600.png" alt="image"></p></details><h4 id="what-are-trusted-manufacturers" tabindex="-1">What are trusted manufacturers? <a class="header-anchor" href="#what-are-trusted-manufacturers" aria-label="Permalink to &quot;What are trusted manufacturers?&quot;">​</a></h4><details class="details custom-block"><summary>A manufacturer that provides unique serial numbers for their devices.</summary><p>Dell, HP, and Lenovo are considered trusted manufacturers. A trusted manufacturer is expected to provide unique serial numbers for their devices. We rely on trusted manufactuers and device serial numbers during device identification. If the agent reports it comes from a trusted manufacturer and a computer already exists inside ImmyBot with the same manufacturer and serial number, then we will automatically associated the agent with the existing computer.</p></details><h4 id="for-computer-rename-are-there-any-other-operators-we-can-use-when-naming-devices-other-then-the-ones-shown-can-we-add-operators" tabindex="-1">For computer rename, are there any other operators we can use when naming devices other then the ones shown? Can we add operators? <a class="header-anchor" href="#for-computer-rename-are-there-any-other-operators-we-can-use-when-naming-devices-other-then-the-ones-shown-can-we-add-operators" aria-label="Permalink to &quot;For computer rename, are there any other operators we can use when naming devices other then the ones shown? Can we add operators?&quot;">​</a></h4><details class="details custom-block"><summary>You can duplicate the Task into your instance an manipulate it however you like.</summary><p>If it&#39;s something you think other MSPs could use, I&#39;d encourage you to submit a request on the <a href="https://community.immy.bot" target="_blank" rel="noreferrer">ImmyBot Community</a> and we can add it.</p></details><h4 id="employee-profile-caching-during-on-boarding-is-this-supported-if-so-how" tabindex="-1">Employee profile caching during on-boarding - is this supported? If so/how? <a class="header-anchor" href="#employee-profile-caching-during-on-boarding-is-this-supported-if-so-how" aria-label="Permalink to &quot;Employee profile caching during on-boarding - is this supported?  If so/how?&quot;">​</a></h4><details class="details custom-block"><summary>ImmyBot will create a profile for the Primary Person you selected for this machine</summary><p>ImmyBot will create a profile for the Primary Person you selected for this machine on the Onboarding screen (It does this via the &quot;Create Profile for Primary Person&quot; task)</p><p>We do this so subsequent tasks that set user level settings like default PDF handler and default browser, have the profile for the primary person and thus that user&#39;s HKCU where those settings live.</p></details><h4 id="is-immybot-able-to-group-devices-and-then-do-role-based-deployments-to-them-i-assume-this-is-done-by-tags" tabindex="-1">Is ImmyBot able to group devices and then do role based deployments to them? I assume this is done by tags? <a class="header-anchor" href="#is-immybot-able-to-group-devices-and-then-do-role-based-deployments-to-them-i-assume-this-is-done-by-tags" aria-label="Permalink to &quot;Is ImmyBot able to group devices and then do role based deployments to them? I assume this is done by tags?&quot;">​</a></h4><details class="details custom-block"><summary>Yes. Tags.</summary><p>Yes, you would accomplish this with tags.</p></details><h2 id="azuread-and-intune" tabindex="-1">AzureAD and Intune <a class="header-anchor" href="#azuread-and-intune" aria-label="Permalink to &quot;AzureAD and Intune&quot;">​</a></h2><h4 id="can-immybot-join-azuread" tabindex="-1">Can ImmyBot join AzureAD? <a class="header-anchor" href="#can-immybot-join-azuread" aria-label="Permalink to &quot;Can ImmyBot join AzureAD?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, via a deployment.</summary><p>Yes. Create a deployment for the Join AzureAD task. We use the bulk enrollment technique and generate a provisioning package to join the machine to AzureAD. We recommend using oAuth over DEM user.</p></details><h4 id="my-azuread-join-action-is-failing-what-are-some-common-fixes" tabindex="-1">My AzureAD Join action is failing, what are some common fixes? <a class="header-anchor" href="#my-azuread-join-action-is-failing-what-are-some-common-fixes" aria-label="Permalink to &quot;My AzureAD Join action is failing, what are some common fixes?&quot;">​</a></h4><details class="details custom-block"><summary>Check MFA, CAPs, and logs.</summary><p>Check if MFA Requirement for Joining is enabled via <a href="https://portal.azure.com/#view/Microsoft_AAD_ConditionalAccess/ConditionalAccessBlade/~/Policies" target="_blank" rel="noreferrer">Conditional Access</a> or <a href="https://portal.azure.com/#view/Microsoft_AAD_Devices/DevicesMenuBlade/~/DeviceSettings/menuId~/null" target="_blank" rel="noreferrer">Azure Device Settings</a>. MFA requirement for all users in <a href="https://portal.azure.com/#view/Microsoft_AAD_ConditionalAccess/ConditionalAccessBlade/~/Policies" target="_blank" rel="noreferrer">Conditional Access</a> will also block the execution, as the package_XXX user will encounter a MFA prompt. Most other situations are noted during execution failure.</p></details><h4 id="can-immybot-make-deploying-via-intune-more-simple" tabindex="-1">Can ImmyBot make deploying via Intune more simple? <a class="header-anchor" href="#can-immybot-make-deploying-via-intune-more-simple" aria-label="Permalink to &quot;Can ImmyBot make deploying via Intune more simple?&quot;">​</a></h4><details class="details custom-block"><summary>Absolutely! There is a global Task labeled &quot;<strong>Deploy ImmyAgent to Intune</strong>&quot;</summary><p>Absolutely! There is a global Task labeled &quot;<strong>Deploy ImmyAgent to Intune</strong>&quot; that can do an excellent job of it.</p><ul><li>Ensure you are using the <a href="https://docs.immy.bot/azure-graph-permissions-setup.html#custom" target="_blank" rel="noreferrer"><strong>Custom</strong> Graph Permissions</a></li><li>Ensure you have added the Graph <strong>Application</strong> permission DeviceManagementConfiguration.ReadWrite.All to your app registration</li><li>Ensure you have re-consented to your linked tenants with your new Custom registration</li><li>If there is a failure of the deployment, there is likely a permissions issue with the app registration</li></ul></details><h4 id="can-immybot-help-migrate-my-customers-to-azuread-from-on-premises-environments" tabindex="-1">Can ImmyBot help migrate my customers to AzureAD from On-Premises environments? <a class="header-anchor" href="#can-immybot-help-migrate-my-customers-to-azuread-from-on-premises-environments" aria-label="Permalink to &quot;Can ImmyBot help migrate my customers to AzureAD from On-Premises environments?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, we have a Task that can migrate machines</summary><p>Yes, we have a Task that can migrate machines to associate the user’s profile to their Azure AD identity and join the machine to Azure AD. It can also do the same to and from Active Directory</p></details><h4 id="can-you-target-devices-in-azure-groups" tabindex="-1">Can you target devices in Azure Groups? <a class="header-anchor" href="#can-you-target-devices-in-azure-groups" aria-label="Permalink to &quot;Can you target devices in Azure Groups?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, but ImmyBot requires an additional permissions</summary><p>Yes, but ImmyBot requires an additional permissions on the ImmyBot app registration. You need to grant the <code>Microsoft Graph - Devices.Read.All</code> permission in order for devices to be pulled from Azure Groups.</p></details><h2 id="compatibility" tabindex="-1">Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;Compatibility&quot;">​</a></h2><h4 id="what-windows-versions-does-immyagent-support" tabindex="-1">What Windows versions does ImmyAgent support? <a class="header-anchor" href="#what-windows-versions-does-immyagent-support" aria-label="Permalink to &quot;What Windows versions does ImmyAgent support?&quot;">​</a></h4><details class="details custom-block"><summary>Any Windows OS that is currently under Microsoft support, is generally supported by ImmyBot</summary><p>The ImmyAgent is written in .NET, and as such supports the same <a href="https://github.com/dotnet/core/blob/main/release-notes/8.0/supported-os.md" target="_blank" rel="noreferrer">Windows versions the .NET runtime supports</a>. <strong>Currently, the ImmyAgent runs on .NET 7 and therefore supports Win7+ devices. However, support for .NET 7 is ending May 14th, 2024.</strong> After May 14th, ImmyBot will be transitioning the Agent to the .NET 8 runtime. Win7 is not officially supported in .NET 8, and as such will no longer be supported in ImmyBot. Older systems may continue to work inside of ImmyBot with necessary updates applied, however, we will not be offering any support for unsupported machines.</p><ul><li>Internal testing has shown Win7 (and similar) machines can still work on .NET 8 as long as they have the necessary updates, utilizing a <a href="https://legacyupdate.net/" target="_blank" rel="noreferrer">3rd party tool such as Legacy Update</a>.</li><li>See <a href="/Documentation/GettingStarted/system-requirements.html">Supported Operating Systems</a></li></ul><div class="danger custom-block github-alert"><p class="custom-block-title">DANGER</p><p>We do not endorse or support agents that utilize Legacy Update or similar tools. The best thing to do is upgrade the system. Use at your own risk.</p></div></details><h4 id="can-i-install-the-immyagent-on-macos-or-linux" tabindex="-1">Can I install the ImmyAgent on MacOS or Linux? <a class="header-anchor" href="#can-i-install-the-immyagent-on-macos-or-linux" aria-label="Permalink to &quot;Can I install the ImmyAgent on MacOS or Linux?&quot;">​</a></h4><details class="details custom-block"><summary>No. We do not support non Windows machines</summary><p>No. We may get there some day but, for the time being, our platform is <strong>Windows only</strong>.</p><p>See <a href="/Documentation/GettingStarted/system-requirements.html">Supported Operating Systems</a></p></details><h4 id="can-the-immyagent-be-used-on-arm-architecture" tabindex="-1">Can the ImmyAgent be used on ARM architecture? <a class="header-anchor" href="#can-the-immyagent-be-used-on-arm-architecture" aria-label="Permalink to &quot;Can the ImmyAgent be used on ARM architecture?&quot;">​</a></h4><details class="details custom-block"><summary>Yes and no.</summary><p>Yes and no. While we don&#39;t actively consider it during the design phase of the agent, it has had a fairly high degree of success with ARM devices.</p></details><h2 id="security-and-certificates" tabindex="-1">Security and Certificates <a class="header-anchor" href="#security-and-certificates" aria-label="Permalink to &quot;Security and Certificates&quot;">​</a></h2><h4 id="what-should-i-do-about-immybot-s-upcoming-code-signing-certificate-change" tabindex="-1">What should I do about ImmyBot&#39;s upcoming code-signing certificate change? <a class="header-anchor" href="#what-should-i-do-about-immybot-s-upcoming-code-signing-certificate-change" aria-label="Permalink to &quot;What should I do about ImmyBot&#39;s upcoming code-signing certificate change?&quot;">​</a></h4><details class="details custom-block"><summary>Update your security platforms to ensure it will still work</summary><p>ImmyBot&#39;s current code-signing certificate is set to expire Feb. 12th, 2025. We plan to switch over to our new certificate a day early on Feb. 11th, 2025 to ensure a smooth transition.</p><p>This certificate is used to sign our Agent binaries &amp; installers delivered to machines.</p><p>Unfortunately, our new certificate&#39;s <code>Organization(O)</code> and <code>Common Name(CN)</code> fields are changing from <code>Immense Networks</code> to <code>ImmyBot LLC</code>.</p><p>New Certificate on Feb. 11th, 2025:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CN=ImmyBot LLC, O=ImmyBot LLC, L=Baton Rouge, S=Louisiana, C=US</span></span></code></pre></div><p>Existing Certificate:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CN=Immense Networks, O=Immense Networks, L=Baton Rouge, S=Louisiana, C=US</span></span></code></pre></div><p>This means if you have followed either the <a href="https://docs.immy.bot/troubleshooting.html#security-software-exclusions" target="_blank" rel="noreferrer">Security Software Exclusions</a> or <a href="https://docs.immy.bot/troubleshooting.html#threatlocker" target="_blank" rel="noreferrer">ThreatLocker</a> Setup guides in the past, you must go through the guides again, adding our new certificate <em><strong>in addition</strong></em> to the existing certificate exclusion.</p></details><h4 id="will-this-certificate-change-mean-i-need-to-generate-all-new-agent-installers-do-i-need-to-re-install-the-immybot-agent-on-all-my-machines" tabindex="-1">Will this certificate change mean I need to generate all new agent installers? Do I need to re-install the ImmyBot Agent on all my machines? <a class="header-anchor" href="#will-this-certificate-change-mean-i-need-to-generate-all-new-agent-installers-do-i-need-to-re-install-the-immybot-agent-on-all-my-machines" aria-label="Permalink to &quot;Will this certificate change mean I need to generate all new agent installers? Do I need to re-install the ImmyBot Agent on all my machines?&quot;">​</a></h4><details class="details custom-block"><summary>No.</summary><p>No. Binaries and installers signed with the existing certificate <em><strong>are valid and will continue to work past Feb. 12th, 2025 indefinitely</strong></em> as they were signed before the certificate expiry. Only new agents releases and installers generated after our transition period will be signed with our new certificate. This is why it is important to keep the prior certificate exclusions for instances with pre-exisiting machines.</p></details><h4 id="sentinelone-how-do-we-define-which-site-immybot-places-the-agent-in-during-installation-of-the-s1-agent" tabindex="-1">SentinelOne - How do we define which site ImmyBot places the agent in during installation of the S1 agent? <a class="header-anchor" href="#sentinelone-how-do-we-define-which-site-immybot-places-the-agent-in-during-installation-of-the-s1-agent" aria-label="Permalink to &quot;SentinelOne - How do we define which site ImmyBot places the agent in during installation of the S1 agent?&quot;">​</a></h4><details class="details custom-block"><summary>Give your deployment an API key, we will handle the rest.</summary><p>Supply ImmyBot with an API Key to SentinelOne, and ImmyBot will look for a Site in your SentinelOne instance that matches the name of the Tenant you are onboarding the computer for.</p></details><h4 id="bitlocker-does-this-write-the-key-to-azure-ad-by-chance" tabindex="-1">BitLocker - does this write the key to Azure AD by chance? <a class="header-anchor" href="#bitlocker-does-this-write-the-key-to-azure-ad-by-chance" aria-label="Permalink to &quot;BitLocker - does this write the key to Azure AD by chance?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, but we cannot verify it after.</summary><p>Yes, but we can&#39;t verify that it is written to Azure AD as that would require additional privileges that our App Registration doesn&#39;t request.</p><p>We also write the BitLocker Recovery Key to Active Directory for Domain Joined machines. This doesn&#39;t require any Group Policy setup, or line of site to the domain controller. This works as long as the machine is joined to a domain and there is a domain controller for that domain in ImmyBot.</p></details><h2 id="agent-management" tabindex="-1">Agent Management <a class="header-anchor" href="#agent-management" aria-label="Permalink to &quot;Agent Management&quot;">​</a></h2><h4 id="can-i-embed-the-immyagent-into-an-image" tabindex="-1">Can I embed the ImmyAgent into an image? <a class="header-anchor" href="#can-i-embed-the-immyagent-into-an-image" aria-label="Permalink to &quot;Can I embed the ImmyAgent into an image?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, expand for more info.</summary><p>Create a PPKG and place it in <code>C:\\Recovery\\Customizations</code>, create the folder if it doesn&#39;t exist.</p><p>You can also use <a href="https://learn.microsoft.com/en-us/windows-hardware/manufacture/desktop/add-a-custom-script-to-windows-setup?view=windows-11" target="_blank" rel="noreferrer">SetupComplete</a> This method was confirmed working on Server 2022.</p><p>Place both the ImmyAgent EXE installer and the SetupComplete.cmd in the C:\\Windows\\Setup\\Scripts directory Content of SetupComplete.cmd can be as simple as: start C:\\Windows\\Setup\\Scripts\\ImmyAgentInstallerBundle.exe /qn</p><p>A member of the ImmyBot community also likes to use the below method to embedded a PPKG into an image:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DISM.exe /Image:D:\\mount /Add-ProvisioningPackage /PackagePath:C:\\Users\\Moi\\Downloads\\ImmyBotAgentInstaller.ppkg</span></span></code></pre></div></details><h4 id="do-i-need-a-separate-usb-installer-per-tenant" tabindex="-1">Do I need a separate USB/Installer per tenant? <a class="header-anchor" href="#do-i-need-a-separate-usb-installer-per-tenant" aria-label="Permalink to &quot;Do I need a separate USB/Installer per tenant?&quot;">​</a></h4><details class="details custom-block"><summary>No.</summary><p>No. Create a USB pointing to your own tenant (or create an “Onboarding” tenant) and don’t select the Auto-Onboard option.</p><p>You will change the tenant of the computer on the Onboarding area of the computer after it comes into New Computers</p></details><h4 id="how-do-i-uninstall-the-immyagent" tabindex="-1">How do I uninstall the ImmyAgent? <a class="header-anchor" href="#how-do-i-uninstall-the-immyagent" aria-label="Permalink to &quot;How do I uninstall the ImmyAgent?&quot;">​</a></h4><details class="details custom-block"><summary>Create a deployment for the &quot;ImmyBot Agent&quot; and set software should be to &quot;Uninstalled&quot;</summary><p>Create a deployment for the &quot;ImmyBot Agent&quot; and set software should be to &quot;Uninstalled&quot;</p><p><img src="https://github.com/immense/immybot-documentation/assets/95599350/02be5654-7393-4f95-bf56-dde089582ccf" alt="image"></p><p>Or run the following from Command Line:</p><div class="language-batch vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">batch</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">wmic</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> product </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">where</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> name=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;ImmyBot Agent&quot;</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> call</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> uninstall /nointeractive</span></span></code></pre></div><p>Or from PowerShell:</p><div class="language-powershell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">powershell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$product </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> Get-WmiObject</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> win32_product </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">|</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> where</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">$_</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">.name </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">-eq</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;ImmyBot Agent&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">Write-Host</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> $product.IdentifyingNumber</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$Arguments </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;/x </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">(</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$product.IdentifyingNumber</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">)</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /quiet /noreboot&quot;</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">Start-Process</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> -</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">FilePath msiexec </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">-</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">ArgumentList $Arguments </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">-</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">Wait </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">-</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">Passthru</span></span></code></pre></div></details><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><h4 id="why-am-i-getting-this-system-update-notification" tabindex="-1">Why am I getting this system update notification? <a class="header-anchor" href="#why-am-i-getting-this-system-update-notification" aria-label="Permalink to &quot;Why am I getting this system update notification?&quot;">​</a></h4><details class="details custom-block"><summary>Because you&#39;re not on the latest version of ImmyBot</summary><p>System update notifications indicate that we&#39;ve released new features or bug fixes for your ImmyBot instance. Here&#39;s what you need to know:</p><ul><li>Updates typically take 5-10 minutes to apply and restart your instance</li><li>During the update, your instance will not be accessible</li><li>No maintenance sessions are triggered on endpoints as a result of the update</li><li>Any running sessions will be restarted after the update completes</li></ul><p>If you prefer to automate updates, you can schedule a time for automatic system updates under <strong>Show More</strong> &gt; <strong>Preferences</strong>. This allows you to set updates to occur during non-business hours to minimize disruption.</p></details><h4 id="where-do-i-find-a-file-that-was-uploaded-to-a-computer-through-immybot-remote-control" tabindex="-1">Where do I find a file that was uploaded to a computer through ImmyBot Remote Control? <a class="header-anchor" href="#where-do-i-find-a-file-that-was-uploaded-to-a-computer-through-immybot-remote-control" aria-label="Permalink to &quot;Where do I find a file that was uploaded to a computer through ImmyBot Remote Control?&quot;">​</a></h4><details class="details custom-block"><summary>%ProgramData%\\RemoteControl\\Shared</summary><p>Files uploaded through ImmyBot Remote Control are stored in a specific location on the target computer:</p><div class="language-batch vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">batch</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">%ProgramData%\\RemoteControl\\Shared</span></span></code></pre></div><p>This folder contains all files transferred during remote control sessions. You can access this location directly through File Explorer or by running a command prompt and navigating to the directory.</p></details><h4 id="do-you-take-requests-for-features-software-tasks-scripts" tabindex="-1">Do you take requests for features/software/tasks/scripts? <a class="header-anchor" href="#do-you-take-requests-for-features-software-tasks-scripts" aria-label="Permalink to &quot;Do you take requests for features/software/tasks/scripts?&quot;">​</a></h4><details class="details custom-block"><summary>Yes, we welcome feature requests and contributions from our community!</summary><p>Yes, we welcome feature requests and contributions from our community! Please submit your requests on the <a href="https://community.immy.bot" target="_blank" rel="noreferrer">ImmyBot Community</a> portal. Our team regularly reviews these requests and prioritizes them based on user demand and alignment with our product roadmap.</p></details><h4 id="domain-join-didn-t-work-what-gives" tabindex="-1">Domain Join didn’t work, what gives? <a class="header-anchor" href="#domain-join-didn-t-work-what-gives" aria-label="Permalink to &quot;Domain Join didn’t work, what gives?&quot;">​</a></h4><details class="details custom-block"><summary>It&#39;s likely that the DC is missing entirely, or ImmyBot hasn&#39;t identified the agent as a DC</summary><p>Make sure there is a Domain Controller in ImmyBot for the machine. If you are using a supported RMM like CW Automate/Control setup the integration so the Domain Controller is imported automatically. Otherwise, you’ll need to install the ImmyAgent on a domain controller for that customer.</p><p>If the Domain Controller doesn’t have the red “Domain Controller” designation, press “Run Inventory”. This may happen if it was recently added to ImmyBot.</p><p>Pay attention to the script output, ImmyBot may be reporting that there is a name collision, or that it was unable to run scripts on the domain controller, usually due to security software.</p><p>The &quot;Set Computer Name and Domain Join&quot; task needs to be run serially. If you&#39;re doing a large batch of onboardings, they may get stuck on this task. Ensure that all of the computers and Domain Controllers are online and connected to ImmyBot to ensure that they get through that task quickly.</p></details><h4 id="immybot-agent-logs-show-an-error-of-the-specified-sas-token-is-expired" tabindex="-1">ImmyBot Agent logs show an error of &quot;The specified SAS token is expired&quot; <a class="header-anchor" href="#immybot-agent-logs-show-an-error-of-the-specified-sas-token-is-expired" aria-label="Permalink to &quot;ImmyBot Agent logs show an error of &quot;The specified SAS token is expired&quot;&quot;">​</a></h4><details class="details custom-block"><summary>This will occur if the device&#39;s system time is incorrect.</summary><p>This will occur if the device&#39;s system time is incorrect. Ensure that the system time is correct and then restart the ImmyBot Agent Service.</p></details><h2 id="miscellaneous" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h2><h4 id="we-are-rebranding-how-do-we-change-our-company-information" tabindex="-1">We are rebranding, how do we change our company information? <a class="header-anchor" href="#we-are-rebranding-how-do-we-change-our-company-information" aria-label="Permalink to &quot;We are rebranding, how do we change our company information?&quot;">​</a></h4><details class="details custom-block"><summary>Branding information is <a href="/Documentation/HowToGuides/branding.html">here</a>.</summary><p>Branding information is <a href="/Documentation/HowToGuides/branding.html">here</a>. If you want to change your ImmyBot subdomain, you need to put submit a ticket to ImmyBot support.</p></details><h2 id="kubernetes-migration" tabindex="-1">Kubernetes Migration <a class="header-anchor" href="#kubernetes-migration" aria-label="Permalink to &quot;Kubernetes Migration&quot;">​</a></h2><p>ImmyBot is in the process of moving from Azure AppServices to Azure Kubernetes clusters. You will get an email indicating that the move is pending along with a maintenance window.</p><details class="details custom-block"><summary>How do I know if my ImmyBot instance is on Kubernetes or AppService?</summary><p>There are a couple of ways to do this.</p><ol><li><p>Within your instance: Show More &gt; SMTP &gt; Click on &quot;Fetch IP Addresses and Hostnames&quot;</p><ul><li>If you see 7 IP addresses under &quot;immy.bot IP Addresses&quot; then you&#39;re on AppService</li><li>If you see 2 IP addresses under &quot;immy.bot IP Addresses&quot; then you&#39;re on Kubernetes</li></ul></li><li><p>Run DIG against your instance URL</p><ul><li>If you get a CNAME Record back then you&#39;re on AppService</li><li>If you get an A Record back then you&#39;re on Kubernetes</li></ul></li></ol></details><details class="details custom-block"><summary>Is there a cost associated with this move?</summary><p>No.</p></details><details class="details custom-block"><summary>What will change?</summary><ul><li>The IP addresses that your agents and instance utilize for command and control. <ul><li>The new IP addresses will be sent along with the notification email.</li></ul></li><li>You will see better stability overall, but especially during workload bursts within ImmyBot</li></ul></details><details class="details custom-block"><summary>Will my ImmyBot instance be available during the migration?</summary><p>No. Your instance will be down for 3 to 7 minutes while the instance spools up on the cluster.</p></details><details class="details custom-block"><summary>What do I need to do?</summary><p>For the most part, nothing. Your endpoints will automatically reconnect to the new infrastructure. There will be no changes to deployments, software, tasks, etc since they&#39;re agnostic to the platform they&#39;re on.</p><p>If you&#39;re instance is not on at least ImmyBot 0.72.0, you will need to update it. To update your instance:</p><ol><li>Log in as an MSP Admin.</li><li>Navigate to Show More &gt; System Update.</li><li>Follow the on-screen instructions to complete the update.</li></ol><p>If your instance is not updated by the time that the migration windows starts, we’ll update your instance as part of the migration process.</p></details><div class="danger custom-block"><p class="custom-block-title">Regarding the IP Address change</p><p>If you&#39;re utilizing any kind of IP Whitelisting, you will need to adjust that with the IP addresses that were sent to you. Alternatively, after the migration is complete, you can get this information from:</p><p><strong>Show More</strong> -&gt; <strong>SMTP</strong> -&gt; <strong>Fetch IP Addresses and domains</strong></p></div><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-label="Permalink to &quot;Next Steps&quot;">​</a></h2><p>After reviewing these FAQs, you might want to explore:</p><ul><li><a href="/Documentation/Troubleshooting/common-issues.html">Common Issues</a> - Solutions to frequently encountered problems</li><li><a href="/Documentation/Troubleshooting/troubleshooting.html">Troubleshooting Guide</a> - Detailed troubleshooting steps</li><li><a href="/immybot-overview.html">ImmyBot Overview</a> - Learn more about ImmyBot&#39;s capabilities</li></ul>`,103)]))}const p=t(s,[["render",n]]);export{c as __pageData,p as default};
